import React from "react";

export default function Media() {
  return (
    <div>
      <div className="container">
        <div className="mt-150 mb-150 mr-50 ml-50">
          <h2>Media</h2>
          <br />
          <p>
            Are you a journalist, food blogger or work for news organization
            looking to cover a mission driven amazing company? <br /> Great,{" "}
            <a href="mailto:mavlonbek@tryfreshbox.com">email</a> us and we will
            be happy to discuss how we can partner together.
          </p>
        </div>
      </div>
    </div>
  );
}
